Your exact command fails because `repos/.../commits` returns a commit list, which does **not** include `.files` unless you query each commit individually.

I ran your command, got this error:
- `cannot iterate over: null`

I then ran the equivalent per-commit fetch and got the first 5 commits with files:

```json
